function klikenGetCartItems(){jQuery.post(fetchCartItems.ajax_url,{action:fetchCartItems.action,_ajax_nonce:fetchCartItems.nonce},function(a){if(!a)return;let b=[],c=[],d=[];sw.config.currency=fetchCartItems.currency;for(let e in a)b.push({id:`${a[e].product_id}`,quantity:`${a[e].quantity}`}),c.push({id:`${a[e].product_id}`,name:`${a[e].product_name}`,price:`${a[e].price}`,quantity:`${a[e].quantity}`,google_business_vertical:"retail"}),d.push({id:`${a[e].product_id}`,name:`${a[e].product_name}`,price:`${a[e].price}`,quantity:`${a[e].quantity}`,currency:sw.config.currency});sw.track("AddToCart",{content_type:"product",contents:b}),sw.gEvent("add_to_cart",{items:c}),sw.register_shopcart({items:d})})}jQuery(document).ready(function(){jQuery('body').on('added_to_cart updated_cart_totals',function(){klikenGetCartItems()})})